parameters.inputSchema:
{
  "type": "object",
  "properties": {
    "parties": {
      "type": "array",
      "items": {"type": "string"},
      "description": "All parties involved in the contract"
    },
    "contractType": {
      "type": "string",
      "description": "Type of contract"
    },
    "keyObligations": {
      "type": "array",
      "items": {
        "type": "object",
        "properties": {
          "party": {"type": "string"},
          "obligation": {"type": "string"}
        }
      }
    },
    "importantDates": {
      "type": "object",
      "properties": {
        "effectiveDate": {"type": "string"},
        "terminationDate": {"type": "string"},
        "renewalDates": {"type": "array", "items": {"type": "string"}}
      }
    },
    "paymentTerms": {
      "type": "string",
      "description": "Payment terms and amounts"
    },
    "terminationClauses": {
      "type": "string",
      "description": "Summary of termination clauses"
    },
    "liabilityIndemnification": {
      "type": "string",
      "description": "Liability and indemnification details"
    },
    "disputeResolution": {
      "type": "string",
      "description": "Dispute resolution mechanism"
    },
    "governingLaw": {
      "type": "string",
      "description": "Governing law and jurisdiction"
    },
    "riskyClauses": {
      "type": "array",
      "items": {"type": "string"},
      "description": "Unusual or high-risk clauses"
    }
  },
  "required": ["parties", "contractType"]
}

